// Coloque aqui suas actions
export const SET_USER = 'SET_USER';
export const SET_WALLET = 'SET_WALLET';
export const REQUESTING = 'REQUESTING';
export const API_RESPONSE = 'API_RESPONSE';

export const actionUserEmail = (email) => ({ type: SET_USER, email });

export const actionRequestApi = () => ({ type: REQUESTING });

export const apiReturn = (obj) => ({ type: API_RESPONSE, payload: <div className="obj"></div> });

export const requestApi = () => async (dispatch) => {
  dispatch(actionRequestApi());
  try {
    const response = await fetch('https://economia.awesomeapi.com.br/json/all');
    const data = await response.json();
    dispatch(apiReturn(data));
  } catch (error) {
    console.log(error);
  }
};
